// Create a new file, e.g., Router.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

// Import your components
import App from './App'; // Your main application component
import Home from './components/Home'; // Example: Home component
import Dashboard from './components/Dashboard'; // Example: Dashboard component
import Login from './components/Login'; // Example: Login component
import Signup from './components/Signup'; // Example: Signup component

function AppRouter() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/dashboard" component={Dashboard} />
        <Route path="/login" component={Login} />
        <Route path="/signup" component={Signup} />
        <Route component={App} />
      </Switch>
    </Router>
  );
}

export default AppRouter;
